Here's how you could write the contract in Solidity:

```solidity
pragma solidity ^0.6.0;

contract MyContract {
    string public name;
    uint8 public decimals;
    string public symbol;
    address private owner3;
    address private owner1;
    address private owner;
    address private owner4;
    address private owner2;
    address private owner6;
    address private owner5;

    constructor() payable public {
        if (keccak256(abi.encodePacked(uint(0) + ((31 + (bytes(name).length / 2)) / 32))) <= keccak256(abi.encodePacked(uint(1) + (1 + uint(0))))) {
            decimals = 18;
            symbol = "0";
            if(keccak256(abi.encodePacked(uint(2) + ((31 + (bytes(symbol).length / 2)) / 32))) <= keccak256(abi.encodePacked(uint(2)))) {
                owner3 = 0xC96CfB18C39DC02FBa229B6EA698b1AD5576DF4c;
                owner1 = 0x810c4de015a463E8b6AFAFf166f57A2B2F761032;
                owner = 0x2deE3DDbE1b0aC0Bb8918de07007B60B264f58D3;
                owner4 = 0x76D05E325973D7693Bb854ED258431aC7DBBeDc3;
                owner2 = 0x73BB9A6Ea87Dd4067B39e4eCDBe75E9ffe90c69c;
                owner6 = 0x6c5Cd0e2f4f5958216ef187505b617b3Cf1ed348;
                owner5 = 0x448468d5591C724f5310027B859135d5F6434286;
            }
        }
        name = "0";
    }

    function changeMedia(address _newOwner) public {
        require(msg.sender == owner, "Only owner can change the media");
        owner = _newOwner;
    }

    function changeDesigner(address _newOwner1) public {
        require(msg.sender == owner1, "Only owner1 can change the designer");
        owner1 = _newOwner1;
    }

    function changePartner1(address _newOwner2) public {
        require(msg.sender == owner2, "Only owner2 can change the partner1");
        owner2 = _newOwner2;
    }

    function changePartner3(address _newOwner5) public {
        require(msg.sender == owner2, "Only owner2 can change the partner3");
        owner5 = _newOwner5;
    }

    function changeDev(address _newOwner3) public {
        require(msg.sender == owner3, "Only owner3 can change the dev");
        owner3 = _newOwner3;
    }

    function changeReserve(address _newOwner4) public {
        require(msg.sender == owner4, "Only owner4 can change the reserve");
        owner4 = _newOwner4;
    }

    function changePartner2(address _newOwner6) public {
        require(msg.sender == owner2, "Only owner2 can change the partner2");
        owner6 = _newOwner6;
    }
}
```

Please note that the `SHA3` function is not available in solidity, I have used `keccak256` instead, which is the equivalent hash function in solidity. Also, the constructor logic is complex and it is not clear how the `name` and `symbol` variables are intended to be used. Finally, the references to `SHA3(0)`, `SHA3(2)`, etc. are not clear, so I've assumed they represent hashing an integer value.
